  \"2016-03-17T20:52:02.381302\",\n\t\"name\": \"community-college-revenue-by-fund-and-object-code\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset provides revenue information
  for community colleges by fund and object code.  Information on the following funds
  is included in this dataset: Unrestricted General Fund, Restricted General Fund
  and Plant Fund.nnOrganizational units financed through the unrestricted general
  fund are those which are directly related with the operation and support of the
  educational program of the college.  The restricted general fund is used to account
  for resources that are available for the operation and support of the educational
  program, but which are restricted as to their use.  Some examples include: Tort
  Liability, Unemployment Compensation, direct Federal grants, Chapter 260E Industrial
  New Jobs Training activities and Iowa Values Fund.nnThe plant fund is used for the
  acquisition or construction of physical property related to major repair and/or
  replacement of community college property.  It may also be used for interest and
  principal payments and other debt service charges.n nMore information regarding
  community college funds and object code descriptions can be found in the Iowa Community
  College Accounting Manual here: https://www.educateiowa.gov/sites/files/ed/documents/Final%2010ccAccounting%20ManualFinalrevisedJuly2009.pdf\",\n\t\"license_title\":
